import Head from 'next/head';

const Meta = () => (
    <Head>
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        <meta charSet="utf-8" />
        <link rel="preconnect" href="https://fonts.gstatic.com" />
        <link href="https://fonts.googleapis.com/css2?family=Amatic+SC:wght@700&family=Josefin+Slab:wght@500&display=swap" rel="stylesheet" />
        {/* TO-DO<link rel="shortcut icon" href="" /> ADD A FAVICON TO IMAGES AND IMPORT HERE TO */}
        {/* <link rel="stylesheet" type="text/css" href="" /> */}
        <title>Farmer's Special</title>
    </Head>
)

export default Meta;
